#DROP TABLE  customers             CASCADE CONSTRAINTS;
USE `Base de Datos Distribuida OE`;

CREATE TABLE CUSTOMERS(
    CUSTOMER_ID INT(6) AUTO_INCREMENT PRIMARY KEY, 
    CUST_FIRST_NAME VARCHAR(20), 
    CUST_LAST_NAME VARCHAR(20), 
    CREDIT_LIMIT DECIMAL(9,2), 
    CUST_EMAIL VARCHAR(30), 
    INCOME_LEVEL VARCHAR(20), 
    REGION CHAR(1)
);

CREATE TABLE CUSTOMERS_REGION_A AS
SELECT * FROM CUSTOMERS WHERE REGION = 'A';

CREATE TABLE ORDER_ITEMS (
    ORDER_ID INT(12), 
    LINE_ITEM_ID INT(3), 
    PRODUCT_ID INT(6), 
    UNIT_PRICE DECIMAL(8,2), 
    QUANTITY INT(8),
    FOREIGN KEY (ORDER_ID) REFERENCES ORDERS(ORDER_ID)
);

SELECT * FROM CUSTOMERS_REGION_A WHERE REGION = 'A';

CREATE TABLE ORDER_ITEMS 
    (ORDER_ID BIGINT(12), 
    LINE_ITEM_ID SMALLINT(3), 
    PRODUCT_ID INT(6), 
    UNIT_PRICE DECIMAL(8,2), 
    QUANTITY INT(8)) ;



select * from ORDER_ITEMS;

DELIMITER //

CREATE PROCEDURE DeleteOrderItem(IN orderId INT)
BEGIN
    DELETE FROM ORDER_ITEMS WHERE ORDER_ID = orderId;
END//

DELIMITER ;


